import React from 'react';
import { Button } from 'reactstrap';

const searchDb = jo => {
    return (
        <div>
        <input className="form-search form-control mr-sm-2" type="search" placeholder="Search" />
        <Button className="button-create">{jo.text}</Button>
        </div>
    )
}

export default searchDb;
